// Home.js
import React from 'react';

const Home = () => {
  const homeStyle = {
    backgroundImage: "url('/assets/backgorundimg.jpg')",
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
    height: '100vh', // Full height
    width: '100%',  // Full width
  };

  return (
    <div style={homeStyle}>
      <h1>Welcome to EndangeraProtect</h1>
      <p>Explore and protect endangered species.</p>
    </div>
  );
};

export default Home;
